fields.object_repr:
Если я смотрю футбол, но наши не играют, всегда болею за более слабую команду.
Почему?
{Тренеруюсь за наших болеть.}

Хозяйка, нанимая новую горничную:
- А скажите, милочка, вы любите попугаев?
- О, не беспокойтесь, мадам, {я ем все.}

Кинозвезда, явившись на прием ко врачу:
- Можно раздеваться, доктор?
- Не нужно, {я только вчера видел ваш последний фильм!..}

Во время семейной ссоры жена кричит мужу:
- Было бы лучше, если бы я вышла за самого дъявола!
- Это невозможно. {Браки между близкими родственниками запрещены.}

Летят два кирпича.
- Друг, а ты-то куда летишь?
- Мне все равно, {лишь бы человек хороший попался!}

Катится колобок. Катится... Катится... А потом останавливается и
говорит:
- {Что-то голова болит.}

